define({"topics" : [{"title":"Set up a VoIP Register Trunk","shortdesc":"\n                     <p class=\"shortdesc\">If you bought a VoIP account with user name and password, you need to set up a         Register Trunk on <span class=\"ph\">Yeastar Cloud PBX</span>.\n                     </p>\n                  ","id":"task_fpj_l3d_2cb","href":"topic\/set_up_a_voip_register_trunk_2.html","menu": {"hasChildren":false,},"tocID":"task_fpj_l3d_2cb-d46e7432","topics":[]},{"title":"Set up a VoIP Peer Trunk ","shortdesc":"\n                     <p class=\"shortdesc\">If the ITSP only provides an IP address or domain for your purchased VoIP account,         you need to set up a Peer Trunk\n                        on the <span class=\"ph\">Yeastar Cloud PBX</span>.\n                     </p>\n                  ","id":"task_wbd_kkd_2cb","href":"topic\/set_up_a_voip_peer_trunk_2.html","menu": {"hasChildren":false,},"tocID":"task_wbd_kkd_2cb-d46e7504","topics":[]},{"title":"Set up a VoIP Account Trunk","shortdesc":"\n                     <p class=\"shortdesc\">Create a VoIP Account Trunk on the <span class=\"ph\">Yeastar Cloud PBX</span>, and provide this         account for the other device to register. In this way, <span class=\"ph\">Yeastar Cloud PBX</span> and the         other device are connected.\n                     </p>\n                  ","id":"task_gpv_3lj_dfb","href":"topic\/set_up_a_voip_account_trunk.html","menu": {"hasChildren":false,},"tocID":"task_gpv_3lj_dfb-d46e7576","topics":[]}]});